code2RawCode :: Word16 -> Maybe Word16
code2RawCode code = go (0, V.length knownCodes - 1)
  where
     go (low,high)
      | high < low = Nothing
      | otherwise =
          let mid = (low + high) `div` 2 in
          case compare code (knownCodes V.! mid) of
            LT -> go (low, mid-1)
            GT -> go (mid+1, high)
            EQ -> Just $ knownRawCodes V.! mid


